DROP TABLE IF EXISTS Food;

CREATE TABLE Food(
   Store      VARCHAR(30),
   Lon        NUMERIC(10,6),
   Lat        NUMERIC(8,6),
   Address    VARCHAR(30),
   Address2   VARCHAR(30),
   City       VARCHAR(30),
   State      CHAR(2),
   Zip        INTEGER,
   Zip4       INTEGER,
   County     VARCHAR(30) NOT NULL
);

